import { StyleSheet, Dimensions } from 'react-native';
const styles = StyleSheet.create({
infoContainer: {
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'flex-start'
  },
  CartButton:{
      height: 50,
      width: 270,
      marginTop: 20,
      marginLeft: 45,
      marginRight: 10,
      borderRadius: 100,
      borderColor: '#2cd18a',
      borderWidth: 1,
      justifyContent: 'center',
      alignItems: 'center'
    },
    text: {
      fontSize: 14,
      color: '#2cd18a'
    }
});

export default styles;
